                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Qué le gusta/gustaba hacer en su tiempo libre"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
