                />

                <CustomInput
                  labelText="Comida favorita"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Color favorito"
                  id="city"
                  formControlProps={{
